import React from 'react';
import { BrowserRouter as Router, Routes, Route, Navigate } from 'react-router-dom';
import { AuthProvider, useAuth } from './contexts/AuthContext';
import Navbar from './components/Navbar';
import Dashboard from './pages/Dashboard';
import Login from './pages/Login';
import Register from './pages/Register';
import LearningModule from './pages/LearningModule';
import Quiz from './pages/Quiz';
import Trivia from './pages/Trivia';
import Profile from './pages/Profile';

// Protected Route wrapper component
const ProtectedRoute = ({ children }) => {
  const auth = useAuth();
  
  if (auth?.loading) {
    return <div>Loading...</div>;
  }

  if (!auth?.currentUser) {
    return <Navigate to="/login" />;
  }

  return children;
};

// Root Route wrapper component
const RootRoute = () => {
  const auth = useAuth();

  if (auth?.loading) {
    return <div>Loading...</div>;
  }

  if (auth?.currentUser) {
    return <Navigate to="/dashboard" />;
  }

  return <Navigate to="/login" />;
};

// App Layout component
const AppLayout = () => {
  const auth = useAuth();

  return (
    <div className="min-h-screen bg-gray-50">
      {auth?.currentUser && <Navbar />}
      <Routes>
        {/* Root route - redirects to login or dashboard based on auth status */}
        <Route path="/" element={<RootRoute />} />

        {/* Auth routes - accessible only when logged out */}
        <Route 
          path="/login" 
          element={auth?.currentUser ? <Navigate to="/dashboard" /> : <Login />} 
        />
        <Route 
          path="/register" 
          element={auth?.currentUser ? <Navigate to="/dashboard" /> : <Register />} 
        />

        {/* Protected routes - require authentication */}
        <Route
          path="/dashboard"
          element={<ProtectedRoute><Dashboard /></ProtectedRoute>}
        />
        <Route
          path="/learn"
          element={<ProtectedRoute><LearningModule /></ProtectedRoute>}
        />
        <Route
          path="/quiz"
          element={<ProtectedRoute><Quiz /></ProtectedRoute>}
        />
        <Route
          path="/trivia"
          element={<ProtectedRoute><Trivia /></ProtectedRoute>}
        />
        <Route
          path="/profile"
          element={<ProtectedRoute><Profile /></ProtectedRoute>}
        />

        {/* Catch all - redirect to login or dashboard */}
        <Route path="*" element={<RootRoute />} />
      </Routes>
    </div>
  );
};

function App() {
  return (
    <AuthProvider>
      <Router>
        <AppLayout />
      </Router>
    </AuthProvider>
  );
}

export default App;
